/*** Mobile Header toggle ***/
function headerResize() {
    var screen_width = $(window).width();
    if (screen_width <= 991) {
        $("body").addClass("has-mob-header");
        $(".navbar-toggler").off("click");
        $(".navbar-toggler").on("click", function() {
            $("header").toggleClass("navbar-show");
            $("#divNavbar").slideToggle(350);
        });
        $("a.cart-link").insertBefore(".menu-main-menu-container"); 
    } else {
        $("body").removeClass("has-mob-header");
        $("header nav").removeClass("navbar-show");
        $(".navbar-toggler").attr("aria-expanded", "false");
        $('.cart-link').insertAfter('.menu-main-menu-container');
    }
}

$(window).resize(function() {
    headerResize();
});
$(window).on("load",function(){
    /*** Same Height of Slider item ***/
    $('.testimonials-slider .slick-track').each(function(){  
     var $columns = $('.item',this);
     var maxHeight = Math.max.apply(Math, $columns.map(function(){
         return $(this).height();
     }).get());
     $columns.height(maxHeight);
    });
    /*** Script For SVG CODE  */
    $(function() {
       jQuery("img.svg").each(function() {
           var $img = jQuery(this);
           var imgID = $img.attr("id");
           var imgClass = $img.attr("class");
           var imgURL = $img.attr("src");

           jQuery.get(
               imgURL,
               function(data) {
                   var $svg = jQuery(data).find("svg");
                   if (typeof imgID !== "undefined") {
                       $svg = $svg.attr("id", imgID);
                   }
                   if (typeof imgClass !== "undefined") {
                       $svg = $svg.attr("class", imgClass + " replaced-svg");
                   }

                   $svg = $svg.removeAttr("xmlns:a");

                   if (!$svg.attr("viewBox") &&
                       $svg.attr("height") &&
                       $svg.attr("width")
                   ) {
                       $svg.attr(
                           "viewBox",
                           "0 0 " + $svg.attr("height") + " " + $svg.attr("width")
                       );
                   }
                   $img.replaceWith($svg);
               },
               "xml"
           );
       });
   });
});
